import React from 'react';
import './style.css';
import Card from '../../components/UI/Card';


const Home = props =>{

  const galleryHeight = 450;
  const galleryStyle = {
    height: galleryHeight+'px',
    overflow:'hidden',
}

  return (
    <div>
      <Card>
        <div className="galleryPost" style={{galleryStyle}}>
         <section style = {{width:'70%'}}>
           <div>
              <img src = {"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSPfskDHuYEbaMZk2KFRMk5LpJqCDTqR9xgug&usqp=CAU"}/>
           </div>
         </section>

         <section style={{width:'30%'}}>
         <div>
              <img src = {"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ9wHYRh9JyaiuDC4P3xAl8fYNWAZWW6128GA&usqp=CAU"} alt=""/>
           </div>
           <div>
              <img src = {"data:image/jpeg;base64,"} alt=""/>
           </div>
           <div>
              <img src = {"ixTumay0wtWiGgua+eIIjpC32piSWwAQNJzajmLLFi6YzbiwpFO1sA7fdR+rvPhosWKLRmiD63WVHMZlYsRSMkqMLp0UWwOqxYj5GQ9hsblAESPmisGPkSsWKsSkWbFUDZBdVaeKxYmGM0UmvERJjksWLBI/Vj+Z3moVWNdPHndYsRALsrZZGyjTlsk96fm60sQRiUN4FYsWImP//Z"} alt=""/>
           </div>
         </section>
        </div>

      </Card>
    </div>
  );
}

export default Home;
